import React from "react";

function BlogCard(props) {
  return (
    <div style={{ border: "1px solid white", padding: "10px", margin: "10px" }}>
      <div>
        Likes: {props.likes}
      </div>
      <div style={{ fontWeight: "bold", fontSize: "18px" }}>{props.title}</div>
      <div style={{ marginTop: "10px" }}>
        <span style={{ fontWeight: "bold" }}>Author:</span> {props.author}
      </div>
      <div style={{ marginTop: "10px" }}>{props.content}</div>
    </div>
  );
}

export default BlogCard;
